import React from 'react';
import Link from 'next/link';
import { Link as NextLink } from '../routes';

class Header extends React.Component {

    render () {
        const title = this.props.title;

        return (
            <React.Fragment>
                <p> {title} </p>
                {this.props.children}

                <Link href="/">
                    <a> Home </a>
                </Link>

                <Link href="/about"> 
                    <a> About </a>
                </Link>

                <Link href="/portfolios"> 
                    <a> Portfolios </a>
                </Link>

                <Link href="/blogs"> 
                    <a> Blogs </a>
                </Link>

                <Link href="/cv"> 
                    <a> CV </a>
                </Link>

                <a><NextLink route='test' params={{id: '2'}}> Test 2</NextLink></a> 
                <NextLink route='/test/5'> Test 5 </NextLink>
            </React.Fragment>
        )
    }
}

export default Header;
